Audit Rights:
["From time to time, as Monsanto or the Steering Committee may request, the Agent shall permit, upon reasonable request and during normal business hours, representatives of Monsanto or the Steering Committee to inspect, with regard to Roundup Products, the Agent's inventories, warehousing, and shipping procedures.", 'Physical inventories shall be conducted by September 30 of every calendar year and Monsanto shall have the right to request physical counts on specific product at any time upon reasonable request (which shall be at Monsanto's cost if there are more than two such counts in any Program Year) and to observe or conduct physical counts with Monsanto's representatives;

â¢reconciling the physical inventory to perpetual records;

â¢physically moving the Roundup Products out of the warehouse by following a First In, First Out ("FIFO") policy; and<omitted>â¢arranging for warehousing of adequate inventory levels of Roundup Products in sufficient quantities to satisfy the criteria set forth in the Annual Business Plan.', 'Upon exercise of its right of audit, and discovery of any disputed item, Monsanto shall provide written notice of dispute to the Agent.', 'The audit shall be at the cost of Monsanto unless any material error has been committed by the Agent, in which case the Agent shall bear the cost of the audit.', "Monsanto shall have the right to periodically audit or have an independent accountant audit, on Monsanto's behalf, all the Roundup Records.", 'At all times, the Agent shall make available via computer and/or original documentation, to the members of the Global Support Team continuous access to the Roundup Records as appropriate on a need-to-know basis, such access shall include, but not be limited to, daily sales updates and additional financial reporting with such detail as Monsanto may reasonably request from time to time.']

["Such records shall be made available for reasonable review, audit and inspection upon reasonable notice and with reasonable frequency, upon SutroVax's request for the purpose of verifying Sutro's calculations of amounts due hereunder, the basis for such calculations (including Sutro's calculation of the Fully Burdened Manufacturing Costs) or payments and Sutro's compliance with the terms and conditions of this Supply Agreement.", "Without limiting the foregoing; Sutro is responsible for auditing the facilities of the suppliers of Components, if any, periodically, and Sutro agrees to provide SutroVax, upon SutroVax's request with a current copy of the audit report of such facilities and to incorporate SutroVax's comments with respect to any corrective action plan related to the Product.", "During the Term and the [***] period thereafter, SutroVax or a SutroVax Affiliate may, during normal working hours and upon reasonable advance notice perform site audits and inspect, or request information relating to, Sutro's or its subcontractor's Facilities and records directly or indirectly involved in the performance of this Supply Agreement or related to the Product(s). Such requests should be made in writing and Sutro will allow for such audits or inspection to occur within [***] days from request (excepting for cause audits) for Sutro's Facilities and within [***] days' from request (excepting for cause audits) for Sutro's subcontractor's facilities. Reasonable advance notice for audits for cause shall not require more than [***] advance notice.", "Accordingly, to permit the Quality Agreement to be finalized within such period, Sutro shall provide SutroVax or its designee access to Sutro's Facilities and records to enable SutroVax or its designee to complete an audit pursuant to Section 5.1 within [***] days after the Effective Date.", "During such an inspection or request for information the inspectors may inquire about the progress of the work being carried out by Sutro or its subcontractor, and are in particular but not exclusively authorized to:

5.1.1 Inspect the Facilities, documents and equipment used, or to be used, in the Manufacture of the Product(s);

5.1.2 Verify the qualifications of the employees and subcontractors carrying out such work and their use of the relevant equipment;





5.1.3 Evaluate all scientific techniques used by Sutro, its subcontractors and their respective employees in the performance of this Supply Agreement and the procedures used in the creation and storage of samples of the Product(s), provided that nothing in this Section 5.1.3 shall require Sutroto disclose any Sutro Core Know-How;

5.1.4 Verify and evaluate information relating to the utilization of the Manufacturing capacity of Sutro's Facilities or its subcontractor's Facilities;

5.1.5 Review correspondence, reports, filings and other documents from Regulatory Authorities to the extent related to the Manufacturing activities hereunder;

5.1.6 Evaluate the implementation of all Manufacturing and process changes made with respect to the Product, including pursuant to any corrective action plan; and

5.1.7 Ascertain compliance with Applicable Laws, the Specifications and this Supply Agreement."]
